import './App.css';
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";
import React, { useState, useEffect, useCallback } from 'react';
import {useDispatch, useSelector} from "react-redux";
import { logout } from "./slices/auth";
import EventBus from "./common/EventBus";
import Home from './components/Home';
import Login from './components/Login';
import Register from './components/Register';
import BoardAdmin from "./components/BoardAdmin";
import BoardModerator from "./components/BoardModerator";
import Profile from "./components/Profile";
import MacroCalculator from "./components/MacroCalculator";
import logo from './img/4306a6b70354473aaaeb549b78efa6b1.png';
import Favourites from "./components/Favourites";
import Logout from "./components/Logout";
import Page404 from "./components/Page404";

const App = () => {
    const [showModeratorBoard, setModeratorBoard] = useState(false);
    const [showAdminBoard, setShowAdminBoard] = useState(false);

    const {user: currentUser} = useSelector((state) => state.auth)
    const dispatch = useDispatch();

    const logOut = useCallback(() => {
        dispatch(logout());
    }, [dispatch]);

    useEffect(() => {
        if (currentUser) {
            setModeratorBoard(currentUser.roles.includes("ROLE_MODERATOR"));
            setShowAdminBoard(currentUser.roles.includes("ROLE_ADMIN"));
        } else {
            setShowAdminBoard(false);
            setModeratorBoard(false);
        }

        EventBus.on("logout", () => {
            logOut();
        });

        return () => {
            EventBus.remove("logout");
        };
    }, [currentUser, logOut]);


  return (
          <BrowserRouter>

                  <nav>
                      <Link to={"/"}>
                          <img height="84px" src={logo} alt="Logo" />
                      </Link>
                      <ul>

                          {currentUser ? (
                              <div>
                                  <li>
                                      <Link to={"/profile"}>
                                          Profile
                                      </Link>
                                  </li>
                                  <li>
                                      <a href="/logout" onClick={logOut}>
                                          LogOut
                                      </a>
                                  </li>
                              </div>
                          ) : (
                              <div>
                                  <li>
                                      <Link to={"/login"}>
                                          Login
                                      </Link>
                                  </li>
                                  <li>
                                      <Link to={"register"}>
                                          Sign Up
                                      </Link>
                                  </li>
                              </div>
                          )}

                          {currentUser && (
                              <li>
                                  <Link to={"/favourites"}>
                                      Favourites
                                  </Link>
                              </li>
                          )}

                          {currentUser && (
                              <li>
                                  <Link to={"/calc"}>
                                      Macro Calc
                                  </Link>
                              </li>
                          )}

                          <li>
                              <Link to={"/home"}>
                                  Home
                              </Link>
                          </li>

                          {showModeratorBoard && (
                              <li>
                                  <Link to={"/mod"}>
                                      Moderator Board
                                  </Link>
                              </li>
                          )}

                          {showAdminBoard && (
                              <li>
                                  <Link to={"/admin"}>
                                      Admin Board
                                  </Link>
                              </li>
                          )}

                      </ul>
                  </nav>

                      <Routes>
                          <Route path="/" element={<Home/>} />
                          <Route path="/home" element={<Home/>} />
                          <Route path="/login" element={<Login/>} />
                          <Route path="/register" element={<Register/>} />
                          <Route path="/profile" element={<Profile/>} />
                          <Route path="/calc" element={<MacroCalculator/>} />
                          <Route path="/favourites" element={<Favourites/>} />
                          <Route path="/mod" element={<BoardModerator/>} />
                          <Route path="/admin" element={<BoardAdmin/>} />
                          <Route path="/logout" element={<Logout />} />
                          <Route path="*" component={<Page404 />} />
                      </Routes>

          </BrowserRouter>
  );
}

export default App;
